def stringcal4(n):
    strn = str(n)
    all = []
    for i in range(0, len(strn)-4):
        inti = int(strn[i])
        inti1 = int(strn[i+1])
        inti2 = int(strn[i+2])
        inti3 = int(strn[i + 3])
        x = inti*inti1*inti2*inti3
        all.append(x)
    print(max(all))


